import React, {useEffect, useState} from "react";


const GlassDetails = ({glass, openGlass})=>{
    const [loading, setLoading] = useState(false);
    const [glasses, setGlasses] = useState([])

    useEffect(() => {
        setLoading(true);
        fetch(`${API_URL}/glasses`)
            .then((response) => response.json())
            .then((data) => {
                setGlasses(data);
                setLoading(false);
            });
    }, []);
    return(
        <>
            <div>
                <h1>Elo</h1>
            </div>
        </>
    )
}

export {GlassDetails}
